global_dic = {} # 保存所有爬取的内容 key 是页数 value 是内容
def back_result_url(cur_string:str)->"back list of r url":
    assert cur_string,"要输入有效的curl"
    result_list = []
    # print(str.split("curl"))
    curl_split = cur_string.split("curl")
    for each in curl_split:
        if "0.json?responseContentType=application" in each and "wkbjcloudbos.bdimg.com/v1" in each and "wkctj.baidu.com/click.gif?" not in each:
            url = re.findall(r"'(http.*?)'",each)
            # result_list.append("curl "+each)
            result_list.append(url[0])

    # print(result_list,len(result_list))
    return  result_list

def req_info(s_url:str)->"back url info":
    assert s_url,"请输入有效的URL"
    res = requests.get(url=s_url)
    # print(res.text)
    key = re.findall(r'wenku_(.*?)\(',res.text)
    # value = re.findall(r'\((.*?)\)',res.text)
    value = res.text.replace("wenku_"+key[0]+"(","")[:-1]
    null = None
    true = True
    false = False
    # print(key,value,len(key),len(value),type(eval(value[0])))
    key = key[0]
    # print(len(value),value)
    value = json_parlse(eval(value))
    global_dic[key] = value

def json_parlse(dic_info:dict)->"back text info":
    txt = ""
    if "body" in dic_info:
        for each in dic_info["body"]:
            if each["t"] == "word":
                txt += each["c"]
    # print(txt)
    return txt

def main(string:str)->"the star function":
    #print("开是main函数了")
    for each in back_result_url(cur_string=string):
        try:
            req_info(s_url=each)
        except:
            print(each)
    # print(global_dic,global_dic.keys())
    # return global_dic
    #第二种直接就返回txt
    txt = ""
    # print([int(i) for i in global_dic])
    lis = [int(i) for i in global_dic]
    # lis_s = lis.sort()
    # print([int(i) for i in global_dic].sort())
